Rewind life and remember
soft edges of the dawn,
a mother’s lullaby lingering,
childish worries long gone;
turn the film in slow-motion,
past giggles on the grass,
let each second shimmer,
let nothing unlatch,
let seasons tumble backward,
love never surrendered—
imprints bright as fire,
tonight as we remember.
Cradle each faint heartbeat
from futures never rendered;
within these gentle frames
rewind—relearn—remember.

Where there is a need, courage will rise;
Quieter than thunder but bright as the skies.
Hands that are reaching, eyes turning to see
The soft glow of kindness, a balm quietly.

No longing is silent, no hunger ignored;
Hope sketches pathways and love is restored.
In whispers unspoken, in work done unseen—
We return to each other through places between.

Where there is a need, let us answer and heed;
Our hearts the soft lanterns, our giving, the seed.

Light breaks where no sun shines;
Under cloaks of dreamless gloom,
It weaves its fibers through the stone—
Quiet golden threads on loom.
Buried seeds remember June, though frost has sealed their eyes;
From unseen thresholds, secrets croon,
And hope, unbidden, tries.
Not all illumination bursts or blinds or shines;
Sometimes, in the hushed heart’s core,
Light breaks where no sun shines.

As less on earth seek truth above,
The pulse of wonder starts to fade;
The silver road that hope had laid
Drifts silent through the boughs thereof.

We barter questions for control,
Look down instead of up and out;
Ignorant, haunted by old doubt—
Still, yearning stirs within the soul.

Yet dawn will reach the upward gaze;
One heart upheld renews the days.

Please spare me your secrets—let nothing cloud,  
No tangled confessions, hushed low, veiled or proud.  
Hang no velvet curtain between you and me;  
Unburden the air, let us both wander free.  

What weight in a whisper, what gloom in a sigh;  
A hint of a storm in the small, darting eye.  
Some hearts crave the puzzle, the thrill of the scheme;  
I seek empty spaces where sunlight can stream.  

We’ll talk of small wonders—a bird on a wire,  
Of laughter in rainstorms, of hands by the fire.  
What is not spoken grows sharper, more near;  
Let mystery linger, outside and clear.  

Please spare me your secrets—leave shadows apart;
I’d rather meet honesty, heart to true heart.
